import React from "react";

export const ChildInMenuItem = (
  onMouseEnterHandler,
  onMouseLeaveHandler,
  onMouseDownHandler,
  name
) => {
  return (
    <li
      className="in-menu-item"
      onMouseEnter={onMouseEnterHandler}
      onMouseLeave={onMouseLeaveHandler}
      onClick={() => onMouseDownHandler(name)}
    >
      {name}
    </li>
  );
};
